import { SupportContainer } from "./SupportContainer";
import { OrderContainer } from "./OrderContainer";
import { UserContainer } from "./UserContainer";
import { MasterContainer } from "./MasterContainer"
import { SubjectContainer } from "./SubjectContainer"
import { WithdrawalContainer } from "./WithrawalContainer"
import { WritersContainer} from "./WritersContainer"
import { SuperadminContainer } from "./SuperadminContainer";




const store = [
    new UserContainer(),
    new SupportContainer(),
    new OrderContainer(),
    new MasterContainer(),
    new SubjectContainer(),
    new WithdrawalContainer(),
    new WritersContainer(),
    new SuperadminContainer(),
]

export default store;
